import React from "react";
import "./signin.css"; // Add a separate CSS file for styling
//import googleLogo from "./google-logo.png"; // Add a Google logo image
//import workoutImage from "./workout-image.jpg"; // Your left-side image

const SignIn = () => {
  return (
    <div className="signin-container">
      {/* Left Image Section */}
      <div className="signin-image">
        <img src="./google-logo.png" alt="Workout" />
      </div>

      {/* Right Sign-In Form */}
      <div className="signin-box">
        <h2>SIGN IN</h2>

        <form>
          <label>Email</label>
          <input type="email" placeholder="Enter your email" required />

          <label>Password</label>
          <input type="password" placeholder="Enter your password" required />

          <button className="signin-button">SIGN IN</button>
        </form>

        {/* Separator Line */}
        <div className="separator">--- or ---</div>

        {/* Google Sign-In Button */}
        <button className="google-signin">
          <img src="./google-logo.png" alt="Google Logo" />
          Sign in with 
        </button>

        {/* Sign-Up Link */}
        <p className="signup-text">
          Don't have an account? <a href="/signup">Sign up</a>
        </p>
      </div>
    </div>
  );
};

export default SignIn;
